import React, { useEffect } from "react";
import userActions from "../../_acmodlations/user.actions";
import { Table ,Row, Col, Button, } from "antd";
import { useDispatch, useSelector } from "react-redux";

const HomePage = () => {
  const dispatch = useDispatch();
  const authentication = useSelector((state) => state.authentication);
  const { user } = useSelector((state) => state.userReducers);
  useEffect(() => {
    dispatch(userActions.userList());
  }, []);
  const columns = [
    {
      title: "Name",
      dataIndex: "name",
      key: "name",
    },
    {
      title: "Gender",
      dataIndex: "gender",
      key: "gender",
    },
    {
      title: "Email",
      dataIndex: "email",
      key: "email",
    },
    {
      title: "Username",
      dataIndex: "username",
      key: "username",
    },
    {
      title: "Password",
      dataIndex: "password",
      key: "password",
    },
    {
      title: "DOB",
      dataIndex: "dob",
      key: "dob",
    },
    {
      title: " Phone Number",
      dataIndex: "phoneNumber",
      key: "phoneNumber",
    },
  ];

  const userLists =
    user &&
    user.map((details, index) => {
      return {
        key: index,
        name:
          details.user.name.title +
          " " +
          details.user.name.first +
          " " +
          details.user.name.last,
        gender: details.user.gender,
        email: details.user.email,
        username: details.user.username,
        password: details.user.password,
        dob: details.user.dob,
        phoneNumber: details.user.phone,
      };
    });
  return (
    <>
      <h1 className="homepage-heading"> Hello {authentication.user.username}</h1>
      <Row>
          <Col>

      <input placeholder="Search here"/>
          </Col>
          <Col>
          </Col>
      </Row>
      <Table columns={columns} dataSource={userLists} />
    </>
  );
};

export default HomePage;
